ic information and company structure. The information adding under this module is common to the other modules of Red Cherries ERP. Module is completely implemented and available in version 5.0 Beta 1";$lang["This module consists of five sections called Administration, Finished Good Inventory, Raw Material Inventory, Sales and Reports. The Administration section allows to manage warehouses, unit and unit conversions, tax details, vehicles, delivery routes and system configurations. System configurations allow to configure the system for different behaviors. Finished Good Inventory and Raw Material Inventory allows to manage finished good and raw material stock respectively. System allows to manage warehouse and lorry stock with different transactions. Sales section allows to manage sales invoices and sales returns. Reports section allows to generate different types of reports for stock balances, transactions, sales and sales returns. Module is completely implemented and available in version 5.0 Beta 1"] = "This module consists of five sections called Administration, Finished Good Inventory, Raw Material Inventory, Sales and Reports. The Administration section allows to manage warehouses, unit and unit conversions, tax details, vehicles, delivery routes and system configurations. System configurations allow to configure the system for different behaviors. Finished Good Inventory and Raw Material Inventory allows to manage finished good and raw material stock respectively. System allows to manage warehouse and lorry stock with different transactions. Sales section allows to manage sales invoices and sales returns. Reports section allows to generate different types of reports for stock balances, transactions, sales and sales returns. Module is completely implemented and available in version 5.0 Beta 1";$lang["Allows to manage the process of producing finished goods in a production line. Careful monitoring of raw materials issued to production line and exact usage and calculate final product cost considering other costing parameters is handled in this module. Module provides variation reports to evaluate the efficiency of production line thereby adjusting parameters to fine tune the efficiency and minimize loses. Initial module implementation is completed and is available in version 6.0. Further development of remaining features will be available in future versions."] = "Allows to manage the process of producing finished goods in a production line. Careful monitoring of raw materials issued to production line and exact usage and calculate final product cost considering other costing parameters is handled in this module. Module provides variation reports to evaluate the efficiency of production line thereby adjusting parameters to fine tune the efficiency and minimize loses. Initial module implementation is completed and is available in version 6.0. Further development of remaining features will be available in future versions.";$lang["Allows to manage donations, reserve services(Including reserving rooms/halls etc.), trainings and other types of services. Reservations can be seen on a calendar. Further, module has features to collect advance payments and collect final payments. Initial module implementation is completed and is available in version 6.0. Further development of remaining features will be available in future versions."] = "Allows to manage donations, reserve services(Including reserving rooms/halls etc.), trainings and other types of services. Reservations can be seen on a calendar. Further, module has features to collect advance payments and collect final payments. Initial module implementation is completed and is available in version 6.0. Further development of remaining features will be available in future versions.";$lang["Allows to create a chart of account structure and create prime entry books. Journal entries can be added for a financial year and if required based on locations. Trial balance, balance sheet and profit and lose accounts can be generated as reports with different search options. Module is completely integrated with Stock Manager and Production Manager modules. Initial module implementation is completed and is available in version 5.0 Beta 8. Further development of remaining features will be available in future versions."] = "Allows to create a chart of account structure and create prime entry books. Journal entries can be added for a financial year and if required based on locations. Trial balance, balance sheet and profit and lose accounts can be generated as reports with different search options. Module is completely integrated with Stock Manager and Production Manager modules. Initial module implementation is completed and is available in version 5.0 Beta 8. Further development of remaining features will be available in future versions.";$lang["Admin and a normal user roles available with default user role permissions. New users can be created for type of admin or normal user. When required additional user roles can be created with custom permissions and can be assigned to users. Module is completely implemented and available in version 5.0 Beta 1."] = "Admin and a normal user roles available with default user role permissions. New users can be created for type of admin or normal user. When required additional user roles can be created with custom permissions and can be assigned to users. Module is completely implemented and available in version 5.0 Beta 1.";$lang["Employee salary details can be maintained in this module. Different types of earnings and deductions can be added and payroll process can be done by generating a salary payment detail script for banks. Module implementation will be completed in version 8."] = "Employee salary details can be maintained in this module. Different types of earnings and deductions can be added and payroll process can be done by generating a salary payment detail script for banks. Module implementation will be comple